const Header = () => (
  // <div className='relative'>
    <div className='flex centering-L'>
      <div>
        <div className='t-sm centering-L10'>https://</div>
        <div className='t-xxlg capitalize margin-right'>Hyemi</div>
      </div> 
      <div>
        <div className='t-sm centering-L10 '>.com</div>
        <div className='t-xxlg capitalize'>Song</div>
      </div>
    </div>
  // </div>
) 
export default Header;
